import React, { Component } from "react";

import '../../css/skeleton.css';
import '../../css/Products.css';

import Header from '../Commons/Header';
import Dashboard from "../menu/Dashboard";


import Button from '@material-ui/core/Button';
import { withStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Input from '@material-ui/core/Input';
import InputBase from '@material-ui/core/InputBase';
import InputLabel from '@material-ui/core/InputLabel';
import TextField from '@material-ui/core/TextField';
import FormControl from '@material-ui/core/FormControl';



const styles = theme => ({
    root: {
        width: '95%',
        marginTop: theme.spacing.unit * 3,
        padding: '10px',
        overflowX: 'auto',
    },
    fondo: {
        backgroundColor: '#e65100',
        color: 'white'
    },
    margin: {
        margin: theme.spacing.unit,
    },
    cssLabel: {
        '&$cssFocused': {
            color: purple[500],
        },
    },
    cssFocused: {},
    cssUnderline: {
        '&:after': {
            borderBottomColor: purple[500],
        },
    },
    cssOutlinedInput: {
        '&$cssFocused $notchedOutline': {
            borderColor: purple[500],
        },
    },
    notchedOutline: {},
    bootstrapRoot: {
        'label + &': {
            marginTop: theme.spacing.unit * 3,
        },
    },
    bootstrapInput: {
        borderRadius: 4,
        position: 'relative',
        backgroundColor: theme.palette.common.white,
        border: '1px solid #ced4da',
        fontSize: 16,
        width: 'auto',
        padding: '10px 12px',
        transition: theme.transitions.create(['border-color', 'box-shadow']),
        // Use the system font instead of the default Roboto font.
        fontFamily: [
            '-apple-system',
            'BlinkMacSystemFont',
            '"Segoe UI"',
            'Roboto',
            '"Helvetica Neue"',
            'Arial',
            'sans-serif',
            '"Apple Color Emoji"',
            '"Segoe UI Emoji"',
            '"Segoe UI Symbol"',
        ].join(','),
        '&:focus': {
            borderRadius: 4,
            borderColor: '#80bdff',
            boxShadow: '0 0 0 0.2rem rgba(0,123,255,.25)',
        },
    },
    bootstrapFormLabel: {
        fontSize: 18,
    },

});

class NewProduct extends Component {


    state = {
        name: ''
    }

    handleChange = name => event => {
        this.setState({
            [name]: event.target.value,
        });
    };

    render() {
        const { classes } = this.props;
        return (
            <section>
                <Header></Header>
                <div className="do-work">
                    <section>
                        <Dashboard option="Productos"></Dashboard>
                    </section>
                    <section className="form-data">
                        <h5>Nuevo producto</h5>
                        <hr />
                        <Paper className={classes.root}>
                            <div>
                                <div>
                                    <div className="six columns">
                                        <InputLabel
                                            htmlFor="custom-css-standard-input"
                                            classes={{
                                                root: classes.cssLabel,
                                                focused: classes.cssFocused,
                                            }}
                                        >
                                            Custom CSS
                                        </InputLabel>

                                    </div>
                                    <div className="six columns">
                                        <label >Unidad de medida</label>
                                        <input className="u-full-width" type="text" placeholder="unidad de medida" id="exampleEmailInput"></input>
                                    </div>
                                </div>

                                <div className="row">
                                    <div className="six columns">
                                        <label >Categoria</label>
                                        <input className="u-full-width" type="text" placeholder="categoria" id="exampleEmailInput"></input>
                                    </div>
                                </div>
                                <div>

                                    <div className="six columns">
                                        <label >Precio de compra</label>
                                        <input className="u-full-width" type="text" placeholder="precio de compra" id="exampleEmailInput"></input>
                                    </div>
                                    <div className="six columns">
                                        <label >Precio de venta</label>
                                        <input className="u-full-width" type="text" placeholder="precio de venta" id="exampleEmailInput"></input>
                                    </div>
                                </div>
                                <div>
                                    <div className="six columns">
                                        <div>
                                            <Button
                                                variant="contained"
                                                size="large"
                                                className={classes.fondo} >
                                                Guardar
                                    </Button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </Paper>
                    </section>
                </div>

            </section>
        )
    };
}

export default withStyles(styles)(NewProduct);
